match:
  window.location.search.substr(1).split('&').forEach(param => {
    const [key, value] = param.split('=');
    if (key && key !== 'grep') {
      openpgp.config[key] = decodeURIComponent(value);
      try {
        openpgp.config[key] = eval(openpgp.config[key]);
      } catch(e) {}
    }
  });
}
